import React from 'react';
import './Button.scss';

export const BUTTON_STYLES = {
    DEFAULT : 'button-default',
    PRIMARY : 'button-primary',
    LIGHT : 'button-light'
}

export const BUTTON_SIZES = {
    SHRINK : 'button-small',
    EXPAND : 'button-medium',
    BASIC : 'button-basic'
}

const Button = props => (
    <div className='button'>
        {props.text}
    </div>
)

export default Button
